import React, { Component } from 'react';
import weatherIcon from '../images/weather.png';




export default class Weather extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-sm-12 text-center">
                        <div className='cont-data'>
                            <h1 className='text-center'>Cairo,Egypt</h1>
                            <h5>
                                <img src={weatherIcon} />
                            </h5>
                            <h2 className='display-1'> 18 &deg;</h2>
                            <h3>
                                <span className='display-1 mx-3'>20</span>
                                <span className='display-1 mx-3'>18</span>

                            </h3>
                        </div>
                    </div>
                </div>
            </div>
        )    
    }
}
